import React, { useState } from 'react';
import { View, Image, ImageBackground, Text, TextInput } from 'react-native';
import { RectButton } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';

import styles from './estilo';
import styleGeral from '../estiloGeral/style';

export default function tEsqueciSenha() {
  const navigation = useNavigation();

  function Avancao() {
    navigation.navigate('tLogin');
  }

  function Voltar() {
    navigation.goBack();
  }

  return (
    <ImageBackground source={require('../../assets/background-image.png')} style={styleGeral.container}>
      <View style={styles.main}>
        <Image style={{ width: 207, height: 225, marginTop: 10, marginLeft: 60 }} source={require('../../assets/logo.png')} />
      </View>

      <View style={styles.main}>
        <Text style={styles.title}>Redefinir minha Senha</Text>

        <TextInput style={styles.input} placeholder="Digite a nova senha" />

        <Text style={styles.description}>&</Text>

        <TextInput style={styles.input} placeholder="Confirme a nova senha" autoCorrect={false} />

        <RectButton style={styles.buttonNext} onPress={Avancao}>
          <Text style={styles.buttonText}>Avan√ßar</Text>
        </RectButton>

        <RectButton style={styles.buttonReturn} onPress={Voltar}>
          <Text style={styles.buttonText}>Voltar</Text>
        </RectButton>
      </View>
    </ImageBackground>
  );
}
